import React from 'react';

const LoginCompo = () => {
    return (
        <>
            <div className="card">
                <div className="card-header">
                    <div className="card-body">
                        <div className="row">
                         <div className="col">
                            <input type="text" placeholder='Enter your name'  className=''/>
                         </div>
                        </div>
                    </div>
                </div>
            </div>
        </>
    );
};

export default LoginCompo;
